            $('.sidebar-menu .list.close').removeClass('hide-display');
            $('.close-panel').addClass('hide-display');
            $('.open-panel').removeClass('hide-display');
        }
    }));

    var url = window.location.href;
    $('.sidebar-wrapper a').each(function() {
